  return (
    <div>
      <h1>Hello!</h1>
      <Potato />
      <Like name="kimchi" isKoreans={true} rating={2} />
      <Like name="cheese" isKoreans={false} rating={5} />
      <Like name="sushi" isKoreans={false} rating={5} />
      {gameILike.map(ele => (
        <Like
          key={ele.id}
          name={ele.name}
          img={ele.image}
          rating={ele.rating}
        />
      ))}
    </div>
  );
}

export default App;
